var copy=require("cp-r"),mkdirp=require("mkdirp"),path=require("canonical-path");module.exports={name:"latest-version",runAfter:["write-files"],description:"Copy the latest version (that was compiled to docs/latest) into docs/versionName",process:function(e,t){var n=t.get("versionData"),r=path.join(t.get("basePath"),t.get("rendering.outputFolder"),"docs"),i=path.join(r,n.latest.name),s=path.join(r,"api");mkdirp(i,function(){copy(s,path.join(i,"api"),{deleteFirst:!0})})}}